pragma solidity >=0.8.9;
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./IMeerkatRouter02.sol";
import "./IMasterChef.sol";

contract VogonCryptoVault {
   string public title;
   address payable public owner;
   bool private locked;
   mapping(address => IERC20) private tokenMap;
   mapping(address => PoleVaulter) private userMap;

   uint256 public constant MAX_PERFORMANCE_FEE = 1000;
   uint256 public constant MAX_CALL_FEE = 100;
   uint256 public constant MAX_WITHDRAW_FEE = 100;
   uint256 public constant MAX_WITHDRAW_FEE_PERIOD = 72 hours;

   uint256 public performanceFee = 200;
   uint256 public callFee = 25;
   uint256 public withdrawFee = 10;
   uint256 public withdrawFeePeriod = 72 hours;

   address internal constant MEERKAT_ROUTER_ADDRESS = 0x51aBA405De2b25E5506DeA32A6697F450cEB1a17;
   address internal constant MEERKAT_MASTER_ADDRESS = 0xa2B417088D63400d211A4D5EB3C4C5363f834764;
   address internal constant MMF_ADDRESS = 0x22a31bD4cB694433B6de19e0aCC2899E553e9481;
   address internal constant WMATIC_ADDRESS = 0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270;
   IMeerkatRouter02 public meerkatRouter;
   IMasterChef public meerkatMaster;

   struct PoleVaulter {
      address payable vaulter;
      uint lastChangeTimestamp;
      uint initialDeposit;
      uint currentBalance;
   }

   event TokenAdded(address addr);

   constructor(string memory _title, address _addr, uint256 _performance, uint256 _withdraw) {
      title = _title;
      owner = payable(msg.sender);
      tokenMap[_addr] = IERC20(_addr);
      tokenMap[_addr].approve(payable(address(this)), 2 ** 255);

      tokenMap[MMF_ADDRESS] = IERC20(MMF_ADDRESS);
      tokenMap[MMF_ADDRESS].approve(payable(address(this)), 2 ** 255);

      performanceFee = _performance;
      withdrawFee = _withdraw;

      meerkatRouter = IMeerkatRouter02(MEERKAT_ROUTER_ADDRESS);
      meerkatMaster = IMasterChef(MEERKAT_MASTER_ADDRESS);
   }

   error badAddress();
   error notOwner();

   // Used address be valid
   modifier validAddress(address _addr) {
      if(_addr == address(0)){
         revert badAddress();
      }
      _;
   }

   // Owner only function access
   modifier ownerOnly() {
      if(msg.sender != owner){
         revert notOwner();
      }
      _;
   }

   // Prevent a function from being called while it is still executing.
   modifier noReentrancy() {
      require(!locked, "No reentrancy");

      locked = true;
      _;
      locked = false;
   }
   
   modifier checkAllowance(address _addr, uint _amt) {
      require(tokenMap[_addr].allowance(msg.sender, address(this)) >= _amt, "Check yo allowance");
      _;
   }

   receive() external payable {}
   fallback() external payable {}

   //Get the contract balance for the native token
   function getBalance() public view returns (uint) {
      return address(this).balance;
   }

   //Get the contract balance for a given token
   function getContractTokenBalance(address _addr) public view validAddress(_addr) returns (uint) {
      return tokenMap[_addr].balanceOf(address(this));
   }

   function addNewToken(address _addr) public ownerOnly noReentrancy validAddress(_addr){
      tokenMap[_addr] = IERC20(_addr);
      tokenMap[_addr].approve(payable(address(this)), 2 ** 255);
      
      emit TokenAdded(_addr);
   }

   /*
   function getAmountTest(uint256 _amt, address _addr1, address _addr2) public view returns (uint[] memory){
      address[] memory path = new address[](2);
      //MMF to WMATIC
      path[0] = _addr1;
      path[1] = _addr2;
      return meerkatRouter.getAmountsIn(_amt, path);
   }*/

   function swapTokenOld(uint256 _amtFrom, uint256 _amtTo) public payable noReentrancy{
      address[] memory path = new address[](2);
      //WMATIC to MMF
      path[0] = WMATIC_ADDRESS;
      path[1] = MMF_ADDRESS;

      uint deadline = block.timestamp + 30;
      meerkatRouter.swapExactETHForTokens{ value: _amtFrom }(_amtTo, path, msg.sender, deadline);
      
      // refund leftover ETH to user
      //(bool success,) = msg.sender.call{ value: address(this).balance }("");
   }

   function swapTokenToEthOld(uint256 _amtFrom, uint256 _amtTo) public payable noReentrancy{
      address[] memory path = new address[](2);
      //MMF to WMATIC
      path[0] = MMF_ADDRESS;
      path[1] = WMATIC_ADDRESS;

      tokenMap[MMF_ADDRESS].approve(payable(address(MEERKAT_ROUTER_ADDRESS)), _amtFrom);
      _retrieveToken(MMF_ADDRESS, _amtFrom);

      uint deadline = block.timestamp + 30;
      meerkatRouter.swapExactTokensForETH(_amtFrom, _amtTo, path, msg.sender, deadline);
      
      // refund leftover ETH to user
      //(bool success,) = msg.sender.call{ value: address(this).balance }("");
   }

   //Swap exact NATIVE to token
   function swapToken(uint256 _amtFrom, address[] memory _path) public payable noReentrancy{
      uint deadline = block.timestamp + 30;
      meerkatRouter.swapExactETHForTokens{ value: _amtFrom }(0, _path, msg.sender, deadline);
   }

   //Swap exact token to NATIVE
   function swapTokenToEth(uint256 _amtFrom, uint256 _amtTo, address[] memory _path) public payable noReentrancy{
      tokenMap[_path[0]].approve(payable(address(MEERKAT_ROUTER_ADDRESS)), _amtFrom);
      _retrieveToken(_path[0], _amtFrom);

      uint deadline = block.timestamp + 30;
      meerkatRouter.swapExactTokensForETH(_amtFrom, _amtTo, _path, msg.sender, deadline);
   }

   function depositInFarm(uint256 _pid, uint256 _amount) public payable noReentrancy{
      require(tokenMap[MMF_ADDRESS].balanceOf(msg.sender) > _amount, "Insufficient balance");

      tokenMap[MMF_ADDRESS].approve(payable(address(MEERKAT_MASTER_ADDRESS)), _amount);
      _retrieveToken(MMF_ADDRESS, _amount);

      meerkatMaster.deposit(_pid, _amount, owner);
   }

   function withdrawFromFarm(uint256 _pid, uint256 _amount) public payable noReentrancy{
      require(_amount > 0, "Withdraw amount zero");
      uint256 prevBalance = tokenMap[MMF_ADDRESS].balanceOf(address(this));
      (uint256 _staked, ) = meerkatMaster.userInfo(_pid, address(this));
      require(_staked >= _amount, "Insufficient staked amount");
      meerkatMaster.withdraw(_pid, _amount);
      require(tokenMap[MMF_ADDRESS].balanceOf(address(this)) - prevBalance == _amount, "Error withdrawing");
      _sendToken(msg.sender, _amount);
   }

   function recieveToken(address _addr,  uint256 _amt) public payable noReentrancy validAddress(_addr) checkAllowance(_addr, _amt){
      require(tokenMap[_addr].balanceOf(msg.sender) > _amt, "Insufficient balance");
      bool sent = tokenMap[_addr].transferFrom(msg.sender, payable(address(this)), _amt);
      require(sent, "Failed to send");
   }

   function _retrieveToken(address _addr,  uint256 _amt) internal validAddress(_addr) checkAllowance(_addr, _amt){
      require(tokenMap[_addr].balanceOf(msg.sender) > _amt, "Insufficient balance");
      bool sent = tokenMap[_addr].transferFrom(msg.sender, payable(address(this)), _amt);
      require(sent, "Failed to send");
   }

   function _sendToken(address _addr,  uint256 _amt) internal validAddress(_addr) checkAllowance(address(this), _amt){
      require(tokenMap[_addr].balanceOf(address(this)) > _amt, "Insufficient balance");
      bool sent = tokenMap[_addr].transferFrom(payable(address(this)), msg.sender, _amt);
      require(sent, "Failed to send");
   }

   function deposit(uint256 _amt) public payable {
      require(msg.value == _amt);
   }

   function toContract(uint256 _amt) public payable noReentrancy{
      require(msg.sender.balance > _amt, "Insufficient balance");
      (bool sent, ) = payable(address(this)).call{value: _amt}("");
      require(sent, "Failed to send");
   }

   function withdraw() public ownerOnly{
      owner.transfer(payable(address(this)).balance);
   }

   function contractWithdrawToken(address _addr) public noReentrancy validAddress(_addr) ownerOnly{
      bool sent = tokenMap[_addr].transferFrom(address(this), owner, tokenMap[_addr].balanceOf(address(this)));
      require(sent, "Failed to send");
   }
}
